import Shop_Data from '../shop/shop.data';

class CollectionName extends React.Component {
    constructor() {
        super();

        this.state = {
            somedata:Shop_Data[0]
        }




        render()
        {
          return(
              <div>
                {this.state.somedata.name} 
              </div> 
          )
        }

      }
    }
export default CollectionName;
